import Navbar from 'react-bootstrap/Navbar'
import React from 'react';
import {Link} from 'react-router-dom';

function NavBar() {
  return (
<Navbar expand="lg" variant="light" bg="light">
  <Container>
    <Navbar.Brand href="#">Navbar</Navbar.Brand>
  </Container>
</Navbar>
  );
}

export default NavBar;
